import React, { useState, useEffect, useCallback } from 'react';
import { useAuth } from '../context/AuthContext';
import Sidebar from '../components/Sidebar';
import { Menu, LogOut, RefreshCw, Loader } from 'lucide-react';
import apiClient from '../config/api';
import toast from 'react-hot-toast';
import MFALogTable from '../components/MFAVerificationLogs/MFALogTable';
import '../styles/MFAVerificationLogs.css';
import '../styles/Sidebar.css';
import '../styles/GlobalHeader.css';

const MFAVerificationLogs = () => {
  const { user, logout } = useAuth();
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const [loading, setLoading] = useState(true);
  const [logs, setLogs] = useState([]);
  const [availableFields, setAvailableFields] = useState([]);
  const [refreshing, setRefreshing] = useState(false);

  useEffect(() => {
    fetchLogs();
    fetchAvailableFields();
  }, []);

  const fetchAvailableFields = async () => {
    try {
      const response = await apiClient.get('/mfa-verification-logs/fields');
      if (response.data.success) {
        setAvailableFields(response.data.fields || []);
      }
    } catch (error) {
      console.error('Error fetching available fields:', error);
    }
  };

  const fetchLogs = useCallback(async () => {
    setLoading(true);
    try {
      const params = new URLSearchParams();
      params.append('orderBy', 'CreatedDate');
      params.append('orderDirection', 'DESC');

      const response = await apiClient.get(`/mfa-verification-logs/logs?${params.toString()}`);
      if (response.data.success) {
        setLogs(response.data.logs || []);
      } else {
        toast.error(response.data.error || 'Failed to fetch MFA Verification Logs');
      }
    } catch (error) {
      const errorMessage = error.response?.data?.error || error.message || 'Failed to fetch MFA Verification Logs';
      toast.error(errorMessage);
    } finally {
      setLoading(false);
      setRefreshing(false);
    }
  }, []);

  const handleRefresh = async () => {
    setRefreshing(true);
    await fetchLogs();
  };

  const handleExportCSV = () => {
    // This will be handled by the table component
  };

  return (
    <div className="dashboard-layout">
      <Sidebar isOpen={sidebarOpen} toggleSidebar={() => setSidebarOpen(!sidebarOpen)} />

      <div className="mfa-verification-logs" style={{ marginLeft: sidebarOpen ? '240px' : '60px' }}>
        <div className="global-header mfa-verification-logs-header">
          <div className="header-content">
            <div className="header-left">
              <button 
                className="sidebar-toggle"
                onClick={() => setSidebarOpen(!sidebarOpen)}
                aria-label="Toggle sidebar"
              >
                <Menu size={20} />
              </button>
              <h1>MFA Verification Logs</h1>
            </div>
            <div className="header-right">
              <div className="header-user-profile">
                <div className="user-avatar">
                  {user?.email?.charAt(0).toUpperCase() || 'U'}
                </div>
                <span className="user-name">{user?.email || 'User'}</span>
                <button onClick={logout} className="logout-btn" title="Logout">
                  <LogOut size={18} />
                </button>
              </div>
            </div>
          </div>
        </div>

        <div className="case-management-content">
          <div className="case-management-main-content">
            <div className="case-management-actions">
              <button 
                onClick={handleRefresh} 
                className="btn-refresh"
                disabled={refreshing || loading}
              >
                {refreshing || loading ? (
                  <Loader className="spinning" size={16} />
                ) : (
                  <RefreshCw size={16} />
                )}
                <span>Refresh</span>
              </button>
            </div>

            {loading && logs.length === 0 ? (
              <div className="loading-container">
                <Loader className="spinning" size={32} />
                <p>Loading MFA Verification Logs...</p>
              </div>
            ) : (
              <MFALogTable 
                logs={logs}
                loading={loading}
                availableFields={availableFields}
                onExportCSV={handleExportCSV}
              />
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default MFAVerificationLogs;
